import Title from './components/Title'
import './App.css';
import { useState } from 'react';

function App() {
  const [events, setEvents] = useState([
    { id: 1, title: 'Bradley"s birthday party', location: 'Inverness', date: '20/6/2022', time: '15:00', type: 'Birthday', description: 'Bring a sleeping bag' },
  ]);


  return (
    <div className="App">
      <Title />

      { // Reference video on why we dont use curl braces and we use parans
        // output lists
        events.map((eve) => (
          <article key={eve.id}>
            <div>
              <p>{eve.type}</p>
              <p>{eve.date}</p>
            </div>
            <div>
              <h2>{eve.title}</h2>
            </div>
            <div>
              <p>{eve.description}</p>
            </div>


          </article>
        ))
      }


    </div>
  );
}

export default App;
